  true,\n\t\"url\": null,\n\t\"notes\": \"As the number of Operation Enduring Freedom/Operation
  Iraqi Freedom (OEF/OIF) Traumatic Brain Injury (TBI) patients has grown, so has
  the need to track and monitor care to meet the lifelong needs of these veterans.
  \ In March 2007, a Computerized Patient Record System (CPRS) OIF/OEF TBI Screening
  Reminder was released.  This is a first-line screening tool to identify potential
  TBI patients.  Additional information about veterans who have been identified as
  possible TBI patients by the initial Screening Reminder is collected through a Comprehensive
  TBI evaluation.  Reminder results, in the form of Health Factors, Comprehensive
  TBI evaluation data, and Comprehensive TBI Follow-up results of individual Veterans
  will be sent to a national database.  This data will be aggregated in order to provide
  relevant responses to key stakeholders, such as members of Congress, to monitor
  the quality of care and to implement system improvements. In addition, tracking
  applications will be used to collect data on TBI patient appointments.\",\n\t\"license_title\":
